import { BrowserRouter, Routes, Route } from "react-router-dom";
import App from "./components/App";
import HomePage from "./pages/HomePage";
import CoursePage from "./pages/CoursePage";
import CourseListPage from "./pages/CourseListPage";
import WishlistPage from "./pages/WishlistPage";
import QuestionListPage from "./pages/QuestionListPage";
import QuestionPage from "./pages/QuestionPage";

function Main() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Route index element={<HomePage />} /> {/* 슬래시라는 경로로들어오면 홈페이지라는 컴포넌트를 보여줌 */}
          <Route path="courses">
            <Route index element={<CourseListPage />} />
            {/* index에 해당하는 컴포넌트는 패쓰 프롭대신에 인덱스를 넣어주면됨*/}
            <Route path="react-frontend-development" element={<CoursePage />} />
          </Route>
          <Route path="wishlist" element={<WishlistPage />} />
          <Route path="questions" element={<QuestionListPage />} />
          <Route path="questions/616825" element={<QuestionPage />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default Main;
